const deleteEntry=async a=>{const b=await fetch(`/api/expense/${a}`,{method:"DELETE"});b.ok?document.location.replace("/dashboard"):location.reload()},budgetEntryHandler=a=>{if(a.target.closest(".delete-button")){const b=a.target.closest(".delete-button").getAttribute("data-id");deleteEntry(b)}};document.querySelector(".budget-entries").addEventListener("click",budgetEntryHandler);